const getWeather = async (city) => {
    const data = await fetch(`https://api.openweathermap.org/data/2.5/weather?q=${city}&appid=952e1a23c8ed07f667c6fa33f4725872` , {mode: 'cors'})
    console.log(data)
    if(data.status === 404){
        error.classList.remove('hidden')
        console.log('error')
    }
    else{
        error.classList.add('hidden')
        const jData = await data.json()
        console.log(jData)
    
        let weatherData = {
            description: jData.weather[0].description,
            city: jData.name,
            country: jData.sys.country,
            temp: jData.main.temp,
            feels: jData.main.feels_like,
            wind: jData.wind.speed,
            humidty: jData.main.humidity,
            icon: jData.weather[0].icon
        }
    
        setBackground(weatherData)
        
        SetWeatherData(weatherData)
    }
 
}

